				<p>вконтакте</p>
			</NavLink>	
			<div className="main-screen__header-login">
				<NavLink to='/login'>
				<button onClick={authMe}>Header render - login</button> {/*onClick={() => setCount(prevCount => prevCount === false ? prevCount = true : prevCount = false)} */}
				</NavLink>
				
			</div>
	 </header>
	);

})

